import darkStars from './dark_stars.png';
import darkMoon from './dark_moon.png';
import darkClouds from './dark_clouds.png';
import darkCastle from './dark_castle.png';

import lightSun from './light_sun.png';
import lightClouds from './light_clouds.png';
import lightFlowers from './light_flowers.png';
import lightHills from './light_hills.png';

export {
  darkStars,
  darkMoon,
  darkClouds,
  darkCastle,
  lightSun,
  lightClouds,
  lightFlowers,
  lightHills
};
